[Form]
public class ConsignmentReplenishmentOrder extends FormRun implements InventDimICtrl_Frm, IRefreshable
{
    InventDimCtrl_Frm_Mov inventDimFormSetup;

}

/// <summary>
/// Returns the inventory dimension controller responsible for displaying inventory dimension controls.
/// </summary>
/// <returns>The <c>InventDimCtrl_Frm_Editable</c> class instance.</returns>
public InventDimCtrl_Frm inventDimSetupObject()
{
    return inventDimFormSetup;
}

/// <summary>
/// Refreshes the consignment replenishment order header.
/// </summary>
public void refresh()
{
    ConsignmentReplenishmentOrderHeader_DS.reread();
}

/// <summary>
/// Updates the design related to inventory dimensions.
/// </summary>
/// <param name = "mode">The type of event that triggered the update.</param>
public void updateDesign(InventDimFormDesignUpdate mode)
{
    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                this.initInventDimFormSetup();
            }

        case InventDimFormDesignUpdate::Active,
             InventDimFormDesignUpdate::FieldChange:
            if (consignmentReplenishmentOrderLine.ItemId)
            {
                InventMovement movement = this.currentLineMovement();

                // For performance reasons, only call the inventDimFormSetup if the consignment replenishment order line has an item ID.
                inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
                inventDimFormSetup.formSetControls(mode == InventDimFormDesignUpdate::Active);
            }
            break;

        default :
            throw error(strFmt("@SYS54195",funcName()));
    }
}

private void initInventDimFormSetup()
{
    Set validInventDimDSset = new Set(Types::String);
    validInventDimDSset.add(inventDim_ds.name());

    InventDimControlIdCollection inventDimControlIdCollection = InventDimControlIdCollection::construct();
    inventDimControlIdCollection.add(inventoryDimensionsGrid.id(), true);
    inventDimControlIdCollection.add(inventoryDimensionsDetails.id(), false);

    inventDimFormSetup = InventDimCtrl_Frm_Mov_ConsignmentOrder::construct();
    inventDimFormSetup.parmCallingElement(InventDimAxFormAdapter::newFromForm(element));
    inventDimFormSetup.parmMovement(this.currentLineMovement());
    inventDimFormSetup.parmValidDataSources(validInventDimDSset);
    inventDimFormSetup.parmControlIdCollectionEnumerator(inventDimControlIdCollection.getEnumerator());
    inventDimFormSetup.init();
}

public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = consignmentReplenishmentOrderLine;
    }

    return docCursor;
}

public void create(boolean _append = false)
{
    Args args = new Args();
    args.caller(element);
    args.name(formStr(ConsignmentReplenishmentOrderCreate));
    args.menuItemType(MenuItemType::Action);
    args.menuItemName(menuItemActionStr(ConsignmentReplenishmentOrderCreate));

    if (consignmentReplenishmentOrderHeader)
    {
        consignmentReplenishmentOrderHeader.write();
    }

    FormRun createOrderForm = classfactory.formRunClass(args);
    createOrderForm.init();
    createOrderForm.run();
    createOrderForm.wait();

    if (createOrderForm.closedOk())
    {
        var newConsignmentReplenishmentOrderHeader = createOrderForm.replenishmentOrder();
        super(_append);
        consignmentReplenishmentOrderHeader.data(newConsignmentReplenishmentOrderHeader);
        consignmentReplenishmentOrderHeader_ds.reread();
        consignmentReplenishmentOrderHeader_ds.rereadReferenceDataSources();

        LineViewTab.setFocus();
    }
}

public int active()
{
    int ret = super();

    consignmentReplenishmentOrderHeader_ds.allowDelete(!ConsignmentProductReceiptJournalLine::existsProductReceiptJournalLine(consignmentReplenishmentOrderHeader.ReplenishmentOrderNumber));
    element.enableVendorAccount();

    return ret;
}

public void executeQuery()
{
    if (element.args().record().TableId == tableNum(ConsignmentReplenishmentOrderHeader) && element.args().record().RecId)
    {
        this.query().dataSourceTable(tableNum(ConsignmentReplenishmentOrderHeader)).addRange(fieldNum(ConsignmentReplenishmentOrderHeader, RecId)).value(int642Str(element.args().record().RecId));
    }
    super();
}

private void enableConsignmentReplenishmentOrderLineActions()
{
    InventTable item            = InventTable::find(consignmentReplenishmentOrderLine.ItemId);
    boolean itemNumberSpecified = consignmentReplenishmentOrderLine.ItemId != '';
    boolean isBatchSpecified    = consignmentReplenishmentOrderLine.inventDim().InventBatchId != '';
    boolean isShelfLife         = item.isShelfLifeItem();
    boolean isItemBatchEnabled  = item.isItemBatchActivated();

    ReqTransNet.enabled(itemNumberSpecified);
    ReqTransexplosion.enabled(itemNumberSpecified);
    ReqMultiLevelPegging.enabled(itemNumberSpecified);

    PdsResetShelfDates.enabled(isShelfLife && isBatchSpecified);
    PdsResetVendBatchInfo.enabled(isItemBatchEnabled);
}

public int active()
{
    int ret;

    ret = super();

    var allowDelete = consignmentReplenishmentOrderLine.ReplenishmentOrderLineStatus == ConsignmentReplenishmentOrderLineStatus::OpenOrder
        && consignmentReplenishmentOrderLine.ReplenishmentQuantity == consignmentReplenishmentOrderLine.RemainingReplenishmentPhysicalQuantity;

    consignmentReplenishmentOrderLine_ds.allowDelete(allowDelete);

    element.updateDesign(InventDimFormDesignUpdate::Active);

    this.enableConsignmentReplenishmentOrderLineActions();

    return ret;
}

public void write()
{
    super();

    if (consignmentReplenishmentOrderLine.InventDimId != inventDim.InventDimId)
    {
        this.initInventDim();
    }

    consignmentReplenishmentOrderLine_ds.reread();
    consignmentReplenishmentOrderLine_ds.refresh();

    element.enableVendorAccount();
}

public void create(boolean _append = false)
{
    super(_append);

    inventDim_ds.create();
}

